import { useEffect, useState } from "react";


function Gif() {
    const key = "t3TIUw0RW4zo9uZFwhpRSQoBd5vyxdBMA2rIFwOjf3E";
    const [gIf, setgIf] = useState({});
    const apiCall = async () => {
        const result = await fetch(
            `https://api.unsplash.com/photos/?client_id=${key}`
        );
        console.log(result);
        const json = await result.json();
        setgIf( json.data.urls.regular );
    };
    useEffect(() => {
        apiCall();
    }, []);

    return (
        <div>
            <img src = {gIf} style={{ width: "300px", height: "300px" }} alt="helo" />
        </div>
            )
}

export default Gif;
